CREATE DEFINER=`root`@`localhost` PROCEDURE `actualizarInvestigador`(

varIdPersona bigint(20),
varInvestigadorReconocidoColciencias tinyint(1), 
varTipoInvestigador int(11),
varurlCVLAC varchar(500),
varCodigoORCID varchar(16),
varIdentificadorScopus varchar(10), 
varResearcherId varchar(12)

)
BEGIN

    IF EXISTS(SELECT pin_persona FROM pe_investigador WHERE `pin_persona` = varIdPersona) THEN
    
		UPDATE `pe_investigador`
		SET
		`pin_rec_colciencias` = varInvestigadorReconocidoColciencias,
