		`pin_cvlac_url` = varurlCVLAC,
		`pin_orcid` = varCodigoORCID,
		`pin_scopus` =varIdentificadorScopus,
		`pin_researcherid` = varResearcherId
		WHERE `pin_persona` = varIdPersona;

	ELSE
		INSERT INTO `pe_investigador`
		(`pin_persona`,
		`pin_rec_colciencias`,
		`pin_tipo_inc`,
		`pin_cvlac_url`,
		`pen_fec_registro`,
		`pin_orcid`,
		`pin_scopus`,
		`pin_researcherid`)
		VALUES
		(varIdPersona,
		 varInvestigadorReconocidoColciencias,
		 varTipoInvestigador,
		 varurlCVLAC,
		 now(),
		 varCodigoORCID,
		 varIdentificadorScopus,
		 varResearcherId);

    END IF;

END ;;
