CREATE DEFINER=`root`@`localhost` PROCEDURE `eliminarHojaVida`(
varIdPersona bigint(20)
)
BEGIN

DELETE FROM pe_doc_soporte
WHERE docp_persona = varIdPersona;

DELETE FROM pe_telefono
WHERE tel_persona = varIdPersona;

DELETE FROM pe_cuenta_bancaria
WHERE cb_persona = varIdPersona;

DELETE FROM pe_email
WHERE email_persona = varIdPersona;

DELETE FROM cert_est_idioma
WHERE cid_idioma IN(SELECT id_id FROM est_idioma
WHERE id_persona = varIdPersona);

DELETE FROM pe_idioma
WHERE id_persona = varIdPersona;

DELETE FROM cert_est_edu_basica
WHERE ceb_educacion_basica IN(SELECT eb_id FROM pe_educacion_basica
WHERE eb_persona = varIdPersona);

delete from `pe_educacion_basica`
WHERE eb_persona = varIdPersona;

DELETE FROM `cert_est_edu_superior`
WHERE esc_educacion_superior IN(SELECT est_id FROM pe_educacion_superior
WHERE est_persona = varIdPersona);

DELETE FROM `cert_est_hom_edu_superior`
WHERE esc_educacion_superior IN(SELECT est_id FROM pe_educacion_superior
WHERE est_persona = varIdPersona);

DELETE FROM `pe_educacion_superior`
WHERE est_persona = varIdPersona;

DELETE FROM cert_est_edu_continua
WHERE cec_educacion_continua IN(SELECT ec_id FROM pe_educacion_continua
WHERE ec_persona = varIdPersona);

delete from `pe_educacion_continua`
WHERE ec_persona = varIdPersona;

DELETE FROM cert_distincion
WHERE pdc_distincion IN(SELECT dist_id FROM pe_distincion
WHERE dist_persona = varIdPersona);

delete from `pe_distincion`
WHERE dist_persona = varIdPersona;

DELETE FROM cert_explaboral
WHERE cep_explaboral IN(SELECT ep_id FROM pe_explaboral
WHERE ep_persona = varIdPersona);

delete from `pe_explaboral`
WHERE ep_persona = varIdPersona;

DELETE FROM `cert_curso_exp_docencia`
WHERE `ced_curso_exp_docencia` in (Select edc_id from pe_cursos_experiencia_docencia 
where edc_exp_docente in (select ped_id from pe_experiencia_docencia where ped_persona = varIdPersona));

DELETE FROM `pe_cursos_experiencia_docencia`
where edc_exp_docente in (select ped_id from pe_experiencia_docencia where ped_persona = varIdPersona);

DELETE FROM `pe_experiencia_docencia`
where ped_persona = varIdPersona;

DELETE FROM `pe_investigador`
WHERE `pin_persona` = varIdPersona;

DELETE FROM `pe_articulos`
WHERE art_persona = varIdPersona;

DELETE FROM `doc_patente`
WHERE `pdc_patente` IN(SELECT ptt_id FROM pe_patente
WHERE ptt_persona = varIdPersona);

DELETE FROM `pe_patente`
where ptt_persona = varIdPersona;

DELETE FROM `doc_producto_conocimiento`
WHERE `pdc_producto_conocimiento` IN(SELECT pc_id FROM pe_producto_conocimiento
WHERE pc_persona = varIdPersona);

DELETE FROM `pe_producto_conocimiento`
where pc_persona = varIdPersona;
    
DELETE FROM `pe_persona`
WHERE `pe_id` = varIdPersona;


END ;;
DELIMITER ;
