CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerAdendas`(
varIdConvocatoria int
)
BEGIN

	SELECT ad.`ade_id` id,
    ad.`ade_fecha` fecha,
    ad.`ade_descripcion` descripcion,
    ad.`ade_tipo_adenda` tipoAdenda,
    ta.`ta_nombre` nombreTipoAdenda,
    Exists(SELECT doca_adenda 
		  FROM con_doc_adenda 
          WHERE doca_adenda = ad.ade_id) tieneDocumento
    FROM con_adenda ad
    inner join ma_tipo_adenda ta on ta.ta_id = ad.`ade_tipo_adenda`
    WHERE ad.ade_convocatoria = varIdConvocatoria; 


END ;;
