CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerConvocatoria`(
varIdConvocatoria int,
out varTipoConvocatoria int(11), 
out varNombreTipoConvocatoria varchar(100), 
out varNucleoBasicoConocimiento int(11), 
out varNombreNucleoBasicoConocimiento varchar(75),
out varFechaInicio datetime, 
out varFechaFin datetime, 
out varNombre varchar(150), 
out varDescripcion varchar(200), 
out varFechaResultados datetime,
out varTieneDocumento tinyint(1),
out varIdSede int,
out varSede varchar(100),
out varIdPrograma int,
out varPrograma varchar(100),
out varCurso varchar(100),
out varNumeroHoras int,
out varanyosminimosexperiencia int
)
BEGIN



SELECT con_tipo_convocatoria,
tc_descripcion,
con_nucleo_basico_conocimiento,
nbc_nombre,
con_fecha_inicio,
con_fecha_fin,
con_nombre,
con_descripcion,
con_fecha_resultados,
con_anyos_minimo_experiencia
INTO 
varTipoConvocatoria, 
varNombreTipoConvocatoria,
varNucleoBasicoConocimiento, 
varNombreNucleoBasicoConocimiento,
varFechaInicio, 
varFechaFin, 
varNombre, 
varDescripcion, 
varFechaResultados,
varanyosminimosexperiencia
FROM con_convocatoria con
inner join ma_nucleo_basico_conocimiento on nbc_id = con_nucleo_basico_conocimiento
inner join ma_tipo_convocatoria on tc_id = con_tipo_convocatoria
WHERE con_id = varIdConvocatoria;

SET varTieneDocumento = false;
IF exists(SELECT dconv_convocatoria 
		  FROM con_documento 
          WHERE dconv_convocatoria = varIdConvocatoria) THEN
    SET varTieneDocumento = true;      
END IF;

IF varTipoConvocatoria = 3 || varTipoConvocatoria = 4 THEN
  SELECT pro.prog_sede,
		 sed.sd_nombre,
		 cur.conc_programa,
		 pro.prog_nombre, 
		 cur.conc_nombre_curso,
		 cur.conc_num_horas
  INTO varIdSede,
	   varSede,
	   varIdPrograma,
	   varPrograma,
	   varCurso,
	   varNumeroHoras
  FROM con_cursos cur
    INNER JOIN ma_programas pro on pro.prog_id = cur.conc_programa
    INNER JOIN ma_sede sed on sed.sd_id = pro.prog_sede
  WHERE conc_convocatoria = varIdConvocatoria;
END IF;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `obtenerConvocatorias` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerConvocatorias`(
  varidUsuario bigint
)
BEGIN

SELECT con.con_id id,
 con.con_tipo_convocatoria tipoConvocatoria,
 tc.tc_descripcion nombreTipoConvocatoria,
 con.con_fecha_fin fechaFin,
 con.con_nombre nombre,
 exists(SELECT dconv_convocatoria 
		FROM con_documento 
        WHERE dconv_convocatoria = con.con_id) tieneDocumento,
 exists(select ptl_id 
		from con_postulacion 
        where ptl_convocatoria = con.con_id
         and ptl_persona = varidUsuario) postulado
FROM con_convocatoria con
 INNER JOIN ma_tipo_convocatoria tc on tc.tc_id = con.con_tipo_convocatoria
ORDER BY con_id DESC;

END ;;
DELIMITER ;
