)
BEGIN

SELECT `est_id` id,
    `est_nivel` nivel,
     nf.nf_nombre nombrenivel,
    `est_institucion_educativa` institucion,
     ie.ie_nombre nombreinstitucion,
    `est_programa_cursado` programa,
    `est_titulo_obtenido` titulo,
    `est_nucleo_basico_conocimiento` nucleoBasicoConocimiento,
     nbc_nombre nombreNucleoBasicoConocimiento,
    `est_year_inicio` anyoInicio,
    `est_year_fin` anyoFinalizacion,
    `est_graduado` graduado,
    `est_fecha_titulo` fechaTitulo,
    `est_titulo_exterior` tituloExterior,
     est_pais_titulo_exterior paisTituloExterior,
     pa.pais_nombre nombrepaisTituloExterior
FROM `pe_educacion_superior` es
 inner join ma_nivel_formacion nf on nf.nf_id = es.est_nivel
 inner join ma_institucion_educativa ie on ie.ie_id = es.est_institucion_educativa
 inner join ma_nucleo_basico_conocimiento nbc on nbc.nbc_id = es.est_nucleo_basico_conocimiento
 left join ma_pais pa on pa.pais_cod = es.est_pais_titulo_exterior
WHERE est_persona = varIdPersona;

END ;;
