CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerExperienciasLaborales`(
  varIdPersona bigint(20)
)
BEGIN

SELECT `ep_id` id,
    `ep_tipoexperiencia` tipoexperiencia,
    te.tex_nombre nombretipoexperiencia,
    `ep_trabajo_actual` trabajoactual,
    `ep_exp_fnsp` fnsp,
    `ep_fechaingreso` fechaIngreso,
    `ep_fecharetiro` fechaRetiro,
    `ep_nucleo_basico_conocimiento` nucleoBasicoConocimiento,
    nbc.nbc_nombre nombreNucleoBasicoConocimiento,
    `ep_tipo_empresa` tipoEmpresa,
    ti.inst_nombre nombreTipoEmpresa,
    `ep_nombre_empresa` nombreempresa,
    `ep_actividad_economica` actividadeconomica,
    ae.acte_nombre nombreActividadEconomica,
    `ep_tipo_contrato` tipoContrato,
    tc.`tipocontr_nombre` nombretipoContrato,
    `ep_cargo` cargo,
    `ep_naturaleza_cargo` naturalezaCargo,
    nc.`nat_nombre` nombrenaturalezaCargo
FROM `pe_explaboral` exp
 INNER JOIN ma_tipo_experiencia te on te.tex_id = exp.ep_tipoexperiencia
 INNER JOIN ma_nucleo_basico_conocimiento nbc on nbc.nbc_id = exp.ep_nucleo_basico_conocimiento
 INNER JOIN ma_tipo_institucion ti on ti.inst_id = exp.ep_tipo_empresa
 INNER JOIN ma_tipo_contrato tc on tc.tipocontr_id = exp.ep_tipo_contrato
 INNER JOIN ma_actividad_economica ae on ae.acte_id = exp.ep_actividad_economica
 INNER JOIN ma_naturaleza_cargo nc on nc.nat_id = exp.ep_naturaleza_cargo
WHERE ep_persona = varIdPersona;

END ;;
