CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerIdiomasHojaVida`(
  varIdPersona bigint(20)
)
BEGIN
SELECT esid.id_id id,
	   esid.id_idioma idioma,
       maid.idioma_nombre nombreIdioma,
	   esid.id_conversacion nivelConversacion,
       nic.ni_nombre nombreNivelConversacion,
       esid.id_escritura nivelEscritura,
       nis.ni_nombre  nombrenivelEscritura,
       esid.id_lectura nivelLectura,
       nil.ni_nombre  nombrenivelLectura,
       esid.id_escucha nivelEscucha,
       nie.ni_nombre nombrenivelEscucha,
	   esid.id_tipo_certificacion tipoCertificacion,
       tc.tci_nombre nombretipoCertificacion,
       esid.id_otra_certificacion otraCertificacion,
       esid.id_puntaje_certificacion puntajeCertificacion
FROM pe_idioma esid
  inner join ma_idioma maid on esid.id_idioma = maid.idioma_id
  inner join ma_nivel_idioma nic on nic.ni_id = esid.id_conversacion
  inner join ma_nivel_idioma nis on nis.ni_id = esid.id_escritura
  inner join ma_nivel_idioma nil on nil.ni_id = esid.id_lectura
  inner join ma_nivel_idioma nie on nie.ni_id = esid.id_escucha
  inner join ma_tipo_certificacion_idioma tc on tc.tci_id = esid.id_tipo_certificacion
WHERE esid.id_persona = varIdPersona
order by maid.idioma_nombre;

END ;;
DELIMITER ;
