    varNombreTipoInvestigador,
    varurlCVLAC,
    varCodigoORCID,
    varIdentificadorScopus, 
    varResearcherId
	FROM `pe_investigador`
     left join ma_tipo_investigador on mti_id = pin_tipo_inc
	WHERE `pin_persona` = varIdPersona;


END ;;
