CREATE DEFINER=`root`@`localhost` PROCEDURE `obtenerPersona`(
  varIdPersona bigint,
  out varNumeroId varchar(20),
  out varTipoId char(4),
  out varNombreTipoId varchar(50),
  out varLugarExpedicion varchar(6),
  out varNombreLugarExpedicion varchar(100),
  out varFechaExpedicion datetime,
  out varLibretaMilitar varchar(15),
  out varDistritoClase varchar(15),
  out varNombres varchar(45),
  out varApellidos varchar(45),
  out varFechaNacimiento datetime,
  out varLugarNacimiento varchar(6),
  out varNombreLugarNacimiento varchar(100),
  out varNacionalidad int(4),
  out varNombreNacionalidad varchar(100),
  out varSexo int(11),
  out varNombreSexo varchar(20),
  out varCiudadResidencia varchar(6),
  out varNombreCiudadResidencia varchar(100),
  out varDireccion varchar(100),
  out varEgresadoUdea tinyint(1),
  out varGrupoEtnico int(2),
  out varNombreGrupoEtnico varchar(100),
  out varDiscapacidad int(2),
  out varNombreDiscapacidad varchar(100),
  out varDisponeRut tinyint(1),
  out varActividadEconomica int(6),
  out varNombreActividadEconomica varchar(100),
  out varDisponibilidadViajar tinyint(1),
  out varTipoVinculacion int(11),
  out varNombreTipoVinculacion varchar(100) ,
  out varTieneCopiaDocumentoIdentificacion tinyint(1),
  out varTieneCopiaLibretaMilitar tinyint(1),
  out varTieneDocumentoRUT tinyint(1),
  out varEmpleadoUdea tinyint(1),
  out varPerfil text
)
BEGIN

SELECT
`pe_numero_id`,
`pe_tipo_id`,
 ti.ti_nombre,
`pe_lugar_expedicion`,
CONCAT(pa.pais_nombre, ' - ', dep.dpto_nombre, ' - ', mun.mpio_nombre),
`pe_fecha_expedicion`,
`pe_libreta_militar`,
`pe_distrito_clase`,
`pe_nombres`,
`pe_apellidos`,
`pe_fecha_nacimiento`,
`pe_lugar_nacimiento`,
CONCAT(pa_nac.pais_nombre, ' - ', dep_nac.dpto_nombre, ' - ', mun_nac.mpio_nombre),
`pe_nacionalidad`,
 pa_nacio.pais_nombre,
`pe_sexo`,
 sex.sex_nombre,
`pe_ciudad_residencia`,
CONCAT(pa_res.pais_nombre, ' - ', dep_res.dpto_nombre, ' - ', mun_res.mpio_nombre),
`pe_direccion`,
`pe_egresado_udea`,
`pe_grupo_etnico`,
 ge.gpet_nombre,
`pe_discapacidad`,
 dis.disc_nombre,
`pe_dispone_rut`,
`pe_actividad_economica`,
 ae.acte_nombre,
`pe_disponibilidad_viajar`,
 pe_empleado_udea,
`pe_tipo_vinculacion`,
 tv.tvi_nombre,
 pe_perfil
INTO
varNumeroId,
varTipoId,
varNombreTipoId,
varLugarExpedicion,
varNombreLugarExpedicion,
varFechaExpedicion,
varLibretaMilitar,
varDistritoClase,
varNombres,
varApellidos,
varFechaNacimiento,
varLugarNacimiento,
varNombreLugarNacimiento,
varNacionalidad,
varNombreNacionalidad,
varSexo,
varNombreSexo,
varCiudadResidencia,
varNombreCiudadResidencia,
varDireccion,
varEgresadoUdea,
varGrupoEtnico,
varNombreGrupoEtnico,
varDiscapacidad,
varNombreDiscapacidad,
varDisponeRut,
varActividadEconomica,
varNombreActividadEconomica,
varDisponibilidadViajar,
varEmpleadoUdea,
varTipoVinculacion,
varNombreTipoVinculacion,
varPerfil
FROM `pe_persona` pe
 inner join ma_tipo_identificacion ti on ti.ti_codigo = pe.pe_tipo_id
 inner join ma_municipio mun on mun.cod_mpio = pe.pe_lugar_expedicion
 inner join ma_departamento dep on dep.dpto_cod = mun.mpio_dpto
 inner join ma_pais pa on pa.pais_cod = dep.dtpo_pais
 inner join ma_municipio mun_nac on mun_nac.cod_mpio = pe.pe_lugar_nacimiento
 inner join ma_departamento dep_nac on dep_nac.dpto_cod = mun_nac.mpio_dpto
 inner join ma_pais pa_nac on pa_nac.pais_cod = dep_nac.dtpo_pais
 inner join ma_pais pa_nacio on pa_nacio.pais_cod = pe.pe_nacionalidad
 inner join ma_municipio mun_res on mun_res.cod_mpio = pe.pe_ciudad_residencia
 inner join ma_departamento dep_res on dep_res.dpto_cod = mun_res.mpio_dpto
 inner join ma_pais pa_res on pa_res.pais_cod = dep_res.dtpo_pais
 inner join ma_sexos sex on sex.sex_id = pe.pe_sexo
 left join ma_grupo_etnico ge on ge.gpet_id = pe.pe_grupo_etnico
 left join ma_discapacidades dis on dis.disc_id = pe.pe_grupo_etnico
 left join ma_actividad_economica ae on ae.acte_id = pe.pe_actividad_economica
 left join ma_tipo_vinculacion_udea tv on tv.tvi_id = pe.pe_tipo_vinculacion
WHERE `pe_id` = varIdPersona;

SET varTieneCopiaDocumentoIdentificacion = 0;
IF exists(SELECT docp_persona 
		  FROM pe_doc_soporte 
          WHERE docp_persona = varIdPersona
          and docp_tipo_doc = 2) THEN
    SET varTieneCopiaDocumentoIdentificacion = 1;      
END IF;

SET varTieneCopiaLibretaMilitar = 0;
IF exists(SELECT docp_persona 
		  FROM pe_doc_soporte 
          WHERE docp_persona = varIdPersona
          and docp_tipo_doc = 8) THEN
    SET varTieneCopiaLibretaMilitar = 1;      
END IF;

SET varTieneDocumentoRUT = 0;
IF exists(SELECT docp_persona 
		  FROM pe_doc_soporte 
          WHERE docp_persona = varIdPersona
          and docp_tipo_doc = 3) THEN
    SET varTieneDocumentoRUT = 1;      
END IF;


END ;;
DELIMITER ;
