CREATE DEFINER=`root`@`localhost` PROCEDURE `validarExistenciaPersona`(
   varNumeroIdentificacion varchar(45),
   out varExiste tinyint(1)
)
BEGIN
		IF EXISTS(SELECT pe_numero_id
				  FROM pe_persona 
				  where pe_numero_id = varNumeroIdentificacion) THEN
		   SET varExiste = 1;			
	    ELSE
           SET varExiste = 0;
	    END IF;

END ;;
